import { useEffect } from "react";
import PokemonListItem from "./PokemonListItem";

export default function PokemonList({ pokemons, news }){
    console.log(pokemons.current_weather);
    useEffect(() => {
        getPokemons().catch(null);
    });
    return(
        <div>
            {pokemons.current_weather?.map((pokemon, index) => 
            <PokemonListItem key={index} {...pokemon} />)
        }
        </div>
    );
}
